import React, { Component} from 'react';
import {Grid, Cell} from 'react-mdl';

class Resume extends Component{
	render(){
		return(
			<div style = {{width: '100%', margin: 'auto'}}>
					<Grid className = "landing-grid">
						<Cell col={8}>
							<div className = "resume-body" style = {{textAlign: 'left'}}>
								<h5>Education</h5>
								<hr></hr>
								<dt>University of California, Los Angeles</dt>
									<dd>2016 - 2020 (Expected)</dd>
									<dd>B.S. Computer Science and Engineering</dd>
								<h5>Languages</h5>
								<hr></hr>
								<dt>Java, C++, C, Python, Javascript, HTML, CSS, Bash, Verilog, XML</dt>
								<h5>Technologies</h5>
								<hr></hr>
								<dt>Android Studio, GNU Emacs, SQLite, React.js, Git, NumPy, Tensorflow</dt>
							</div>
						</Cell>
						<Cell col = {4}>
						</Cell>
					</Grid>
			</div>
		)
	}
}

export default Resume;
